import React from "react"

export default function RsvpClosed(props) {
    return (
        <div className="formClosed">
            <p className="note">Thank you for responding.</p>
            <button className="rsvpChange"
                onClick={() => props.setOpenRsvpForm(true)}>
                Change RSVP </button>
        </div>
    )
}
